import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./pages/Home";
import Donate from "./pages/Donate";

// Example placeholder pages
function About() {
  return (
    <div className="content-section">
      <h2>About Us</h2>
      <p>
        We are a community-driven platform focused on helping the needy by
        connecting donors and volunteers. Our mission is to reduce food waste
        and ensure donations reach those who need them most.
      </p>
    </div>
  );
}

function Blog() {
  return (
    <div className="blog-section">
      <h2>Our Blog</h2>
      <div className="blog-container">
        <div className="blog-card">
          <img src="/blog1.jpg" alt="Helping Hands" />
          <h3>Helping Hands</h3>
          <p>
            Learn how our volunteers are making an impact by distributing food
            and essentials in rural areas.
          </p>
          <button className="btn">Read More</button>
        </div>

        <div className="blog-card">
          <img src="/blog2.jpg" alt="Donation Drive" />
          <h3>Donation Drive</h3>
          <p>
            Our recent donation drive collected over 500 meals and distributed
            them to local shelters.
          </p>
          <button className="btn">Read More</button>
        </div>

        <div className="blog-card">
          <img src="/blog3.jpg" alt="Community Support" />
          <h3>Community Support</h3>
          <p>
            Strong communities create strong futures. Join us in our journey to
            make a difference.
          </p>
          <button className="btn">Read More</button>
        </div>
      </div>
    </div>
  );
}

function Contact() {
  return (
    <div className="content-section">
      <h2>Contact Us</h2>
      <p>Email: support@foodconnect.org</p>
      <p>Phone: +91 98765 43210</p>
      <p>Address: Hyderabad, India</p>
    </div>
  );
}

// Navbar Component
function Navbar() {
  return (
    <nav
      style={{
        background: "#333",
        padding: "10px 20px",
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
      }}
    >
      <h2 style={{ color: "white" }}>FoodConnect</h2>
      <div>
        <Link to="/" style={linkStyle}>
          Home
        </Link>
        <Link to="/about" style={linkStyle}>
          About
        </Link>
        <Link to="/blog" style={linkStyle}>
          Blog
        </Link>
        <Link to="/donate" style={linkStyle}>
          Donate
        </Link>
        <Link to="/contact" style={linkStyle}>
          Contact
        </Link>
      </div>
    </nav>
  );
}

const linkStyle = {
  color: "white",
  marginLeft: "20px",
  textDecoration: "none",
};

// Footer Component
function Footer() {
  return (
    <footer
      style={{
        background: "#333",
        color: "white",
        textAlign: "center",
        padding: "20px",
        marginTop: "40px",
      }}
    >
      <p>Â© {new Date().getFullYear()} FoodConnect. All Rights Reserved.</p>
    </footer>
  );
}

// Main App Component
function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/donate" element={<Donate />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
